import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";
import Logo from "./Logo";
import Search from "./Search";
export default function History() {
  return (
    <div
      style={{
        margin: 0,
        padding: 0,
        width: "100%",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
      }}
    >
      <Navbar />
      <Logo />

      <Footer />
    </div>
  );
}
